var storefrontApp = angular.module('storefrontApp');

storefrontApp.controller('feedbackController', ['$scope', '$uibModalInstance', 'feedbackService', 'dialogService', function ($scope, $uibModalInstance, feedbackService, dialogService) {
    $scope.setContactUsForm = function (form) {
        $scope.formContactUs = form;
    }

    $scope.submit = function () {
        $scope.formContactUs.$setSubmitted();
        if ($scope.formContactUs.$invalid) {
            return;
        }
        $scope.model.isProcessing = true;
        feedbackService.postFeedback($scope.model).then(function (response) {
            $scope.model.isProcessing = false;
            $scope.model.isProcessed = true;
            $scope.model.isSubmittedSuccessfully = true;
            $scope.closeModal();
            dialogService.showDialog(null, 'feedbackController', 'storefront.form-thank-you.tpl');
        }, function (response) {
            $scope.model.isProcessing = false;
            $scope.model.isProcessed = true;
        });
    }

    $scope.closeModal = function () {
        $uibModalInstance.close();
    }

    initialize();

    function initialize() {
        $scope.model = {
            isProcessing: false,
            isProcessed: false,
            isSubmittedSuccessfully: false,
            contact: {}
        };
    }
}]);
var storefrontApp = angular.module('storefrontApp');

storefrontApp.controller('productController', ['$scope', '$window', '$sce', 'catalogService', function ($scope, $window, $sce, catalogService) {
    initialize();

    $scope.selectVariation = function () {
        selectVariation($scope.selectedVariation.id);
    }

    $scope.showProductOverview = function () {
        $scope.productOverviewVisible = true;
        $scope.productReleaseNotesVisible = false;
    }

    $scope.showProductReleaseNotes = function () {
        $scope.productReleaseNotesVisible = true;
        $scope.productOverviewVisible = false;
    }

    function initialize() {
        $scope.productOverviewVisible = true;
        var productIds = $window.productIds[0];
        catalogService.getProduct(productIds).then(function (response) {
            var product = response.data[0];
            $scope.product = product;
            selectVariation(product.variations[0].id);
            var fullDescription = _.find(product.properties, function (p) { return p.name === 'Overview' });
            if (fullDescription) {
                $scope.fullDescription = $sce.trustAsHtml(fullDescription.value);
            }
        });
    }

    function selectVariation(variationId) {
        var variation = _.find($scope.product.variations, function (v) { return v.id === variationId });
        if (variation) {
            variation.locale = _.find(variation.properties, function (p) { return p.name === 'Locale' });
            variation.versionNumber = _.find(variation.variationProperties, function (p) { return p.name === 'ReleaseVersion' });
            variation.releaseDate = _.find(variation.variationProperties, function (p) { return p.name === 'ReleaseDate' });
            variation.compatibility = _.find(variation.variationProperties, function (p) { return p.name === 'Compatibility' });
            variation.releaseNotes = _.find(variation.variationProperties, function (p) { return p.name === 'ReleaseNote' });
            variation.downloadLink = _.find(variation.variationProperties, function (p) { return p.name === 'DowloadLink' });
            $scope.selectedVariation = angular.copy(variation);
        }
    }
}]);
var storefrontApp = angular.module('storefrontApp');

storefrontApp.controller('accountController', ['$scope', '$window', '$localStorage', '$location', 'communityService', 'customerService', 'accountApi', 'mainContext', function ($scope, $window, $localStorage, $location, communityService, customerService, accountApi, mainContext) {
    $scope.customer = {};
    var customer = $scope.customer;

    $scope.initialize = function () {
        customerService.getCurrentCustomer().then(function(customer) {
            $scope.temp = angular.copy(customer.data);
            $scope.user = customer.data;
            $scope.newAddresses = {};
            if (!_.isEmpty($scope.user.addresses))
                if (!angular.isUndefined(_.first($scope.user.addresses).organization))
                    angular.extend($scope.newAddresses, { organization: _.first($scope.user.addresses).organization });
        });
    }

    $scope.updateAccount = function (changedData, newAddresses) {
        var changedAddresses = communityService.getProfileParameters(newAddresses);
        accountApi.updateAccount(changedData, mainContext.getCustomer).$promise;
        accountApi.updateAddresses([changedAddresses], mainContext.getCustomer).$promise;
        document.location.href = "/vc-community";
    }

    $scope.cancel = function () {
        $scope.user = angular.copy($scope.temp);
    }

    mainContext.getCustomer = $scope.getCustomer = function () {
        customerService.getCurrentCustomer().then(function (response) {
            var addressId = 1;
            _.each(response.data.addresses, function (address) {
                address.id = addressId;
                addressId++;
            });
            response.data.isContact = response.data.memberType === 'Contact';
            mainContext.customer = $scope.customer = response.data;
        });
    };

    $scope.getInvite = function () {
        debugger;
        var email = $scope.customer.email; 
        accountApi.getInvite({ Emails: [email] }).$promise.then(function (response) {
            debugger;
            if (response.succeeded)
                document.location.href = "account/confirminvite";
            else
                console.log(response.errors);
        });
    }

    $scope.initialize();
}])
   .factory('mainContext', function () {
       return {};
   });

var storefrontApp = angular.module('storefrontApp');

storefrontApp.controller('contributorController', ['$scope', '$window', '$timeout', '$location', '$localStorage', 'communityService', 'customerService', function ($scope, $window, $timeout, $location, $localStorage, communityService, customerService) {

    function initialize() {

customerService.getCurrentCustomer().then(function(customer) {
            $scope.user_name = customer.data.firstName;
            $scope.reloadContributorData();
        });
    }

    $scope.reloadContributorData = function () {
        communityService.getContributor($scope.user_name).then(function (contributor) {
            if (!_.isEmpty(contributor)) {
                $scope.contributor = contributor[$scope.step];
            }
            $scope.loaded = true;
        })
    }

    function updateStep () {
        if ($scope.step == 'licenseTerms')
            $scope.step = 'contactInfo';
        else if ($scope.step == 'contactInfo')
            $scope.step = 'projectInfo';
        else {
            $scope.formCompleted = true;
            $timeout(function() { document.location.href = "/vc-community" }, 1700);
        }
        $scope.reloadContributorData();
    }

    $scope.updateContributorInfo = function (data) {
        communityService.addContributorInformation(data, $scope.step, $scope.user_name).then(function (resp) {
            if (resp)
                $scope.contributor = {};
        })
        updateStep();
    }
    
    initialize();
}]);

var storefrontApp = angular.module('storefrontApp');

storefrontApp.controller('communityController', ['$scope', '$q', '$window', '$location', '$localStorage', 'communityService', 'customerService', function ($scope, $q, $window, $location, $localStorage, communityService, customerService) {
    $scope.loaded = false;
    $scope.githubUser = null;

    customerService.getCurrentCustomer().then(function (user) {
        $scope.user = user.data;
        if (!_.isEmpty($scope.user.addresses)) {
            if (!angular.isUndefined(_.first($scope.user.addresses).organization))
                $scope.user.organization = _.first($scope.user.addresses).organization;
        }

        var githubAccount = _.find(user.data.externalLogins, { loginProvider: 'GitHub' });

        var stackExchangeAccount = _.find(user.data.externalLogins, { loginProvider: 'StackExchange' });

        if (!angular.isUndefined(githubAccount)) {
            communityService.getGithubProfile(githubAccount.providerKey).then(function(profile) {
                var profile = profile.data;
                communityService.getGithubStatistic(profile.login).then(function (statistic) {
                    $scope.github = { poolRequest: statistic.data.total_count };
                    $scope.githubUser = profile;
                    if (!profile.name) {
                        $scope.github.userName = profile.login;
                    }
                    else
                        $scope.github.userName = profile.name;

                    communityService.checkUserPersonalData($scope.user, $scope.github.poolRequest).then(function(resp) {
                        $scope.percentage = resp.percentage;
                        $scope.points = resp.points;
                        $scope.rating = resp.rating;
                        $scope.loaded = true;
                    });
                });
            });
        }

        if (!angular.isUndefined(stackExchangeAccount)) {
            $q.all(
                    [
                        //get info
                        communityService.getStackExchangeProfile(stackExchangeAccount.providerKey),
                        communityService.getStackExchangeQuestions(stackExchangeAccount.providerKey),
                        communityService.getStackExchangeAnswers(stackExchangeAccount.providerKey)
                    ])
                .then(function(results) {
                    $scope.stackExchange = {
                        userName: results[0].data.items[0].display_name,
                        raiting: results[0].data.items[0].reputation,
                        questions: results[1].data.total,
                        answers: results[2].data.total
                    };
                });
        }
        $scope.loaded = true;
    });
}]);
